export default {
  model: { event: 'change', prop: 'value' },
  props: {
    placeholder: {
      type: String,
      default: '选择'
    },
    valueFormat: {
      type: String,
      default: 'yyyy-MM-dd HH:mm:ss'
    },
    size: {
      type: String,
      default: 'mini'
    },
    dateType: {
      type: String,
      default: 'year'
    },
    value: {
      type: [Array, String, Number, Object, Date],
      default: ''
    }
  },
  computed: {
    inputVal: {
      set: function(val) {
        this.$emit('change', val)
      },
      get: function() {
        return this.value
      }
    }
  }
}
